<div class="parrafo">
        <p class="texto">Nayarit, un hermoso estado ubicado en la costa del Pacífico de México, es conocido por su rica cultura, impresionantes paisajes naturales y playas paradisíacas. Si estás buscando descubrir los encantos de este maravilloso destino, has llegado al lugar adecuado.</p>
        <br>
        <p class="texto">En Nayarit, encontrarás destinos turísticos emblemáticos como Sayulita, famoso por sus vibrantes playas y ambiente bohemio, así como la histórica ciudad de Tepic, capital del estado, con su arquitectura colonial y variada oferta cultural. También puedes explorar lugares como San Blas, con su encanto colonial y exuberantes manglares, o disfrutar de las hermosas playas de Rincón de Guayabitos y Nuevo Vallarta.</p>
        <br>
        <p class="indicaciones">Simplemente elige el municipio que te interese y accederás a una lista completa de los principales lugares turísticos que puedes visitar.</p>
